import React, { useState } from "react";
import { Container, Form, Nav, Navbar } from "react-bootstrap";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import "./nav.component.css";

const NavComponent = (props) => {
	let { setSearch, searchResults } = props;
	console.log(searchResults);

	return (
		<>
			<Router>
				<Navbar
					fixed="top"
					className="shadow"
					expand="lg"
					bg="dark"
					variant="dark"
				>
					<Container>
						<div className="col-lg-4">
							<Navbar.Brand href="/">
								<strong className="primary">Anime</strong>
								List
							</Navbar.Brand>
						</div>
						<Navbar.Toggle aria-controls="basic-navbar-nav" />
						<Navbar.Collapse id="basic-navbar-nav">
							<Nav className="position-relative col-lg-6">
								<Form className="flex-grow-1">
									<Form.Control
										id="search"
										className="text-center"
										autoComplete="off"
										type="search"
										onChange={(e) => {
											setSearch(e.target.value);
										}}
									></Form.Control>
									<div
										className="position-absolute shadow rounded w-100"
										id="search_results"
									>
										{searchResults.map((result) => {
											<div key={result.mal_id}>
												{result.title}
											</div>;
										})}
									</div>
								</Form>
							</Nav>
							<Nav className="col-lg-6 justify-content-end">
								<Nav.Link>Signup</Nav.Link>
								<Nav.Link className="primary">Login</Nav.Link>
							</Nav>
						</Navbar.Collapse>
					</Container>
				</Navbar>
			</Router>
		</>
	);
};

export default NavComponent;
